Eu tenho mto orgulho de saber que herdei de vc, esse apego com cartinhas, convitinhos, desenhos e bilhetinhos. 

O que mtos acham que é lixo, eu classifico como tesouros! 
Não há dinheiro que pague as emoções registradas em cartas, convites, bilhetinhos... Saber que a pessoa parou e dedicou o tempo dela pra escrever alguma coisa pra vc. Pra te convidar para festejar algum momento importante pra ela. Isso tem um valor incalculável pra mim. 

E eu sempre gostei de guardar essas coisas. Acho mto gostoso sentar, pegar minha pasta de recordações e olhar uma por uma. E assim era a minha vó. 
Nostálgica como eu. 
Aliás, eu sou nostálgica como ela era. 🤗💕

Esse aí, foi o convite do meu aniversário de 1 ano. Achei nas coisas dela. 🥰
Intacto! Guardado com o mesmo amor, o mesmo carinho que eu guardo as minhas recordações. 

Ah vó, tem tanto da Sra em mim! Como eu agradeço a Deus por ser herdeira dos melhores tesouros que a Sra poderia deixar!!! 

Te amo e te amarei pra sempre! 💕

🥺💔😭🌟

